pragma solidity ^0.4.24;

contract currencyOracle{ 

    /**
        Contract variables
     */

    address public owner;
    address public operator;
    uint256 public updateFee;
    uint public ids = 0;
    uint public gasPrice;
    uint public updateGas = 65000;
    uint public fee = 0.0002 ether;

    struct Currency {
        string symbol;
        string value_avg;
        string value_sell;
        string value_buy;
        uint last_updated;
    }

    mapping (uint => Currency) currencies;


    /**
        Event declarations
     */

    event addNewCurrencyEvent(uint id, string symbol);
    event requestCurrencyUpdateEvent(address indexed from, uint id);
    event updateCurrencyEvent(uint id);
    event updatedFeeEvent(uint value);
    event updatedGasPriceEvent(uint value);
    event collectedBalanceFundsEvent(address addr, uint amount);
    event addedNewOperatorEvent(address addr);

    //Contract Constructor
    constructor() public {
        owner = msg.sender;
        gasPrice = tx.gasprice;
        updateFee = gasPrice * updateGas + fee;
    }

    //Function modifiers

    modifier operatable(){
        require(msg.sender == owner || msg.sender == operator, "Sender not operatable");
        _;
    }

    modifier lastUpdateCheck(uint _id){
        require((now - currencies[_id].last_updated) >= 3 minutes, "Update frequency limit");
        _;
    }

    modifier checkFee(){
        require(msg.value == updateFee, "msg.value != than updateFee");
        _;
    }

    modifier checkOwnerFunds(){
        if(owner.balance < updateGas*gasPrice){
            owner.transfer(msg.value);
        }
        require(owner.balance >= updateGas*gasPrice);
        _;
    }

    /**
     * @notice Add a new operator address
     * @param _operator new operator address
     */
    function addOperator(address _operator) public operatable returns (bool){
        require(_operator != address(0), "Not valid address"); //Operator must be valid address
        require(_operator != owner, "Address not owner"); //Operator address must be different than owner address
        operator = _operator;
        emit addedNewOperatorEvent(_operator);
        return true;
    }

    /**
     * @notice Add new currencty to the contract structure
     * @param _symbol currency symbol
     * @param _avg currency avg value
     * @param _sell currency sell value
     * @param _buy currency buy value
     */
    function addNewCurrency(string _symbol, string _avg, string _sell, string _buy) 
        public operatable returns (bool) {
        ids++;
        currencies[ids] = Currency(_symbol, _avg, _sell, _buy, now);
        emit addNewCurrencyEvent(ids, _symbol);
        return true;
    }

    /**
     * @notice Payable function to request currency update, the emitted event fires the update retrieval
     * @param _id currency to update
     */
    function requestCurrencyUpdate(uint _id) public 
        payable lastUpdateCheck(_id) checkFee checkOwnerFunds {
        emit requestCurrencyUpdateEvent(msg.sender, _id);
    }

    /**
     * @notice Function called from the backend service to update currency value as requesteds
     * @param _id currency id
     * @param _avg currency avg value
     * @param _sell currency sell value
     * @param _buy currency buy value
     */
    function updateCurrency(uint _id, string _avg, string _sell, string _buy) 
        external operatable returns (bool) {

        Currency storage c = currencies[_id];
        c.value_avg = _avg;
        c.value_sell = _sell;
        c.value_buy = _buy;
        c.last_updated = now;
        emit updateCurrencyEvent(_id);
        return true;
    }

    /**
     * @notice Change the fee to pay in order to update currency
     * @param _value new fee value
     */
    function updateUsageFee(uint256 _value) public operatable {
        require(_value >= 0.00002 ether);
        fee = _value;
        updateFee = gasPrice * updateGas + fee;
        emit updatedFeeEvent(_value);
    }

    function updateGasPrice() public operatable {
        gasPrice = tx.gasprice;
        updateFee = gasPrice * updateGas + fee;
        emit updatedGasPriceEvent(tx.gasprice);
    }
    /**
     * @notice Gets information about the currency
     * @param _id currency internal ID
     * @return currency struct
     */
    function getCurrency(uint _id) public view returns (string, string, string, string, uint){
        Currency memory c = currencies[_id];
        return (c.symbol, c.value_avg, c.value_sell, c.value_buy, c.last_updated);
    }

    /**
     * @notice Withdraw funds from contract to owner
     */
    function getFunds() public {
        require(msg.sender == owner, "Sender not owner");
        owner.transfer(address(this).balance);
        emit collectedBalanceFundsEvent(owner, address(this).balance);
    }

    /**
     * @notice get Contract balance
     * @return contract balance
     */
    function getBalance() public view returns (uint){
        return address(this).balance;
    }
    /**
     * @notice default fallback function to prevent Ether sending to the contract
     */
    function () public payable {
        revert();
    }

}//end cotization_Oracle

